import React, { useEffect } from 'react'
import jwt_decode from "jwt-decode"
import { useDispatch } from "react-redux"
import userActions from '../redux/actions/userActions'
import {GoogleLogin} from "react-google-login";
import { connect } from 'react-redux';

function GoogleSignUp(props) {
    const responseGoogle = async (res) => {
    console.log(res)
    const profileObj = jwt_decode(res.credential)
        const userData = {
            fullname: res.profileObj.name,
            email: res.profileObj.email,
            password: res.profileObj.jti,
            country: "arg",
            photo: res.profileObj.picture,
            from: "google"
        }
        //console.log(userData)
        await props.signUpUser(userData)
    }
    // useEffect(()=>{
    //     google.account.id.initialize({
    //         client_id:"802070442112-p8eqcc02hidtdhhprf04nrhem1d2mdek.apps.googleusercontent.com",
    //         callback: handleCallbackResponse
    //     })
    //     google.accounts.id.renderButton(
    //         document.getElementById("g-button"),
    //         gbutton,
    //         { theme: "outline", size: "medium" }
    //     )
    // })
    return (
        <div id='googleButton'>
            <GoogleLogin
            /*fields = "name,email,id,picture"*/
            clientId="802070442112-p8eqcc02hidtdhhprf04nrhem1d2mdek.apps.googleusercontent.com"
            buttonText='martin puto'
            onSuccess={responseGoogle}
            onFailure={responseGoogle}
            cookiePolicy={'single_host_origin'}
            />
        </div>
    )
}
const mapDispatchToProps = {
    signUp: userActions.signUp
}

export default connect(null, mapDispatchToProps) (GoogleSignUp)
